// Declare global variables (elements, colors, etc.)
let dashboardTitleElement;
let madaSvg;
let clientLogoSvg;
let clientLogoContainer;
let navBtns;
let rightSection;
let homeBtn;
let customBtn;

let clientLogo;



// Render initial UI elements, get attributes/telemetry and/or make API requests
const renderInitUi = function(){
    const {stateController} = self.ctx;
    // Render dashboard title depending on dashboard state
    const dashboardTitle = stateController && stateController.dashboardIdValue ? buildDashboardTitle() : "Dashboard Title";
    
    dashboardTitleElement.text(dashboardTitle);
    
    // Render logo or nav buttons depending on current dashboard state
    const stateIndex = stateController? stateController.getStateIndex() : 0;
    // console.log({stateIndex});
    
    if(stateIndex > 0) {
        clientLogoContainer.css({display: "none"});
        navBtns.css({display: "flex"});
    } else {
        clientLogoContainer.css({display: "block"});
        navBtns.css({display: "none"});
        
        renderLogo();
    }
    
    renderCustomButton();
    
    handleResize();
};

const handleDashboard = function(ctx){
    const grid = $("#gridster-background");
    // console.log({grid})
    if(grid)
        grid.css({
            maxWidth: "1920px",
            margin: "auto",
            height: "100%",
            display: "block"
        });
};

const handleToolbar = function(ctx){
    // Hide toolbar trigger button
    const toolbarTrigger = $(".mat-fab-toolbar-content mat-fab-trigger");
    
    if(toolbarTrigger.length > 0){
        toolbarTrigger.hide();
        
        const toolbarActionPanels = $("mat-toolbar mat-fab-actions .tb-dashboard-action-panel");
        const toolbarButtons = $(toolbarActionPanels[1]).children("button");
        const fullscreenBtn = toolbarButtons.filter(function(_, element){
            return $(element).text() === "fullscreen";
        }).first();
        
        fullscreenBtn.click();
    }
};

const handleCustomBtnClick = function($event){
    if ($event) $event.stopPropagation();
    
    const {actionsApi, stateController} = ctx;
    
    if(!stateController) return;
    
    const descriptor = actionsApi.getActionDescriptors("customButton")[0];

    if(!descriptor) return;
    
    const {entityId, entityName, entityLabel} = stateController.getStateParams();
    
    const additionalParams = {};
    
    actionsApi.handleWidgetAction($event, descriptor, entityId, entityName, additionalParams, entityLabel);
};

// Add any events listeners to rendered elements 
const addEventListeners = function(){
    const {$container, stateController} = self.ctx;
    
    customBtn.click(handleCustomBtnClick);
    
    if(!stateController) return;
    
    homeBtn.click(function(){stateController.navigatePrevState(0)});
};

self.onInit = function() {
    const ctx = self.ctx;
    // console.log({ctx});
    const {$container, settings} = ctx;
    
    // Initial handlers (functions to handle dashboard workarounds, e.g. handling fullscreen mode)
    handleToolbar();
    handleDashboard();
    
    // Define DOM elements
    dashboardTitleElement = $container.find(".brandingNav__title");
    madaSvg = $container.find(".brandingNav__madaSvg");
    clientLogoSvg = $container.find(".clientLogo__svg");
    clientLogoContainer = $container.find(".clientLogo");
    navBtns = $container.find(".brandingNav__navBtns");
    rightSection = $container.find(".brandingNav__rightSection");
    homeBtn = $container.find(".homeBtn");
    customBtn = $container.find(".customBtn");
    
    // Define settings
    clientLogo = settings.clientLogo;
    
    
    // Load static assets (images, svg, etc.)
    
    
    // Render initial UI
    renderInitUi();
    
    // Add event handlers
    addEventListeners();
};


self.onDataUpdated = function() {
    
};

self.onResize = function() {
    handleResize();
};

self.onDestroy = function() {
    
};

