self.actionSources = function() {
    return {
        'customButton': { // Action source Id (unique action source identificator)
           name: 'Custom button', // Display name of action source, used in widget settings ('Actions' tab).
           value: 'customButton', // Action source Id
           multiple: false 
        }
    };
};

const renderCustomButton = function(){
    const {actionsApi, $scope, settings} = ctx;
    
    const descriptor = actionsApi.getActionDescriptors("customButton")[0];
    // console.log({descriptor});
    $scope.customButtonIcon = "mode_horiz"; // Default icon
    if(!descriptor) {
        customBtn.hide();
        return;
    }
    
    $scope.customButtonIcon = descriptor.icon;
    $scope.customButtonName = descriptor.name;
};

const renderLogo = function(){
    const image = self.ctx.$container.find(`.clientLogo__svg image`);
    
    image.attr({href: clientLogo});
    
    image[0].onload = function(){
        const y = 64 - image.height();
        image.attr({y});
    };
};

const handleResize = function(){
    const {ctx} = self;
    const widgetHeight = ctx.height;
    const widgetWidth = ctx.width;
    
    const madaSvgRatio = 375/(110 + 16); //NOTE: width/height
    
    const madaSvgWidth = madaSvgRatio * widgetHeight;
    madaSvg.css({width: madaSvgWidth});
    
    const clientLogoRatio = 202/(86 + 30);
    
    const clientLogoWidth = clientLogoRatio * widgetHeight;
    clientLogoSvg.css({width: clientLogoWidth});
};

const varsRegex = /\${([^}]*)}/g;

const insertVariable = function(pattern, name, value){
    let result = pattern;
    let match = varsRegex.exec(pattern);
    while (match !== null) {
        const variable = match[0];
        const variableName = match[1];
        if (variableName === name) {
          result = result.replace(variable, value);
        }
        match = varsRegex.exec(pattern);
    }
    return result;
};


const buildDashboardTitle = function(){
    let result = "";
    
    const {stateValue, states, stateObject} = self.ctx.stateController;
    const state = stateObject.find(function(state){return state.id === stateValue});
    const stateName = states[stateValue].name;
    
    const {params} = state;
    const entityName = params && params.entityName ? params.entityName : ""; 
    const entityLabel = params && params.entityLabel ? params.entityLabel : "";
    
    result = insertVariable(stateName, "entityName", entityName);
    result = insertVariable(result, 'entityLabel', entityLabel);
    
    for (const prop of Object.keys(params)) {
        if (params[prop] && params[prop].entityName) {
            result = insertVariable(result, prop + ':entityName', params[prop].entityName);
        }
        if (params[prop] && params[prop].entityLabel) {
            result = insertVariable(result, prop + ':entityLabel', params[prop].entityLabel);
        }
    }
    
    return result;
};

